import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './pages/login_page/index';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/upload-both" element={<UploadBoth />} />
        <Route path="/upload-sec1" element={<UploadSec1 />} />
        <Route path="/upload-sec2" element={<UploadSec2 />} />
        <Route path="/pa" element={<PA />} />
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
};

export default App;
